function function_exists(function_name){
if(typeof function_name=='string'){
return (typeof window[function_name]=='function');
}else{
return (function_name instanceof Function);
}}
function startResumeCounter(){
var timer=60000;
$(document).ready(function (){
updateResumeCount();
setInterval(function (){
updateResumeCount();
}, timer);
});
}
function updateResumeCount(){
$.post("/ajax.php", {'action': 'getResumeCount'}, function (data){ //console.log(data);
$('.resumeCount').html(data);
if($('.s-load-users').length){
$('.s-load-users .user').html(getTermination(data, 'пользователь', 'пользователя', 'пользователей'));
$('.s-load-users .buy').html(getTermination(data, 'приобрел', 'приобрели', 'приобрели'));
}});
}
function getTermination(num, word1, word2, word3){
number=num.substr(-2);
if(number > 10&&number < 15){
return word3;
}else{
number=number.substr(-1);
if(number==0){
return word3;
}
if(number==1){
return word1;
}
if(number > 1&&number <=4){
return word2;
}
if(number > 4){
return word3;
}}
}
function isJson(str){
try {
JSON.parse(str);
} catch (e){
return false;
}
return true;
}
function setCookie(name,value,days){
var expires="";
if(days){
var date=new Date();
date.setTime(date.getTime() + (days*24*60*60*1000));
expires="; expires=" + date.toUTCString();
}
document.cookie=name + "=" + (value||"")  + expires + "; path=/";
}
function getCookie(name){
var nameEQ=name + "=";
var ca=document.cookie.split(';');
for(var i=0;i < ca.length;i++){
var c=ca[i];
while (c.charAt(0)==' ') c=c.substring(1,c.length);
if(c.indexOf(nameEQ)==0) return c.substring(nameEQ.length,c.length);
}
return null;
}
function eraseCookie(name){
document.cookie=name +'=; Path=/; Expires=Thu, 01 Jan 1970 00:00:01 GMT;';
};
let banner=document.querySelector(".bannerBottom");
let close=document.querySelector(".bannerBottom .bannerClose");
close.addEventListener('click', event=> {
banner.classList.remove("show");
setCookie('bannerClosed', '1', 31);
});
showBanner(30);
$(window).scroll(function(){
if($(window).scrollTop() + $(window).height() / 2 >=($(document).height() / 2)){
showBanner();
}});
function showBanner(sec){
if(banner.classList.contains("show")===false&&getCookie("bannerClosed")!=='1'){
if(sec!==undefined){
setTimeout(function (){
showBanner();
}, sec*1000);
}else{
banner.classList.add("show");
}}
};